import React from "react";
import { Link } from "react-router-dom";

function Product({ thumbnail, price, title, category, id }) {
    console.log("Product wala id", id);
   
    return (
        <div className="max-w-xs">
           <div className="w-full aspect-square">
             <img className="w-full h-full object-cover"  src={thumbnail} /> </div>
            <div>{price}</div>
            <div>{title}</div>
            <div>{category}</div>
            <Link to={"/products/" + id} className="text-grey-700 bg-white border border-black">view details</Link>
           
        </div>
         
    ); 
   
}

export default Product;
